import React, {useState} from 'react';
import Button from '@material-ui/core/Button';

function App(props) {
    const [fromPrevious, setFromPrevious] = useState(false);

    const nextStep = () => {
        if (fromPrevious === true) {
            return (
                <form>
                    <h1>Is this an emergency?</h1>
                    <p>Stop and call 911 if you are experiencing:</p>
                    <ul>
                        <li>
                            Severe, constant chest pain or pressure
                        </li>
                        <li>
                            Extreme difficulty breathing
                        </li>
                        <li>

                        </li>
                    </ul>
                    <select id = "dropdown">
                        <option value="UT Austin">UT Austin</option>
                        <option value="UMich">University of Michigan</option>
                        <option value="Catholic">Catholic University of America</option>
                    </select>
                </form>
            );
        }
    };

    return (
        <div>
            <div style={{display: 'flex',  justifyContent:'center', alignItems:'center', height: '200px'}}>
                <h1>Quick COVID-19 Diagnosis</h1>
            </div>
            <div style={{display: 'flex',  justifyContent:'center', alignItems:'center', height: '100px'}}>
                <p>
                    This easy-to-use tool can direct your next steps in the potential case of COVID-19.
                </p>
            </div>
            <div style={{display: 'flex',  justifyContent:'center', alignItems:'center', height: '50px'}}>
                <button variant="contained" color="primary" onClick = {() => setFromPrevious(true)}>Start Screening</button>
            </div>
            <div style={{display: 'flex',  justifyContent:'center', alignItems:'center', height: '50px'}}>
            {nextStep()}
            </div>

        </div>
    );
}

export default App;
